import React, { useState, useRef, useCallback } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import './landingNavigation.css';

const LandingNavigation = ({ mainSections }) => {
  const [activeSection, setActiveSection] = useState(null);
  const [expandedSection, setExpandedSection] = useState(null);
  const [expandedSubsection, setExpandedSubsection] = useState(null);
  const [isAnimating, setIsAnimating] = useState(false);
  const animationTimeoutRef = useRef(null);

  const clearPendingAnimations = useCallback(() => {
    if (animationTimeoutRef.current) {
      clearTimeout(animationTimeoutRef.current);
      animationTimeoutRef.current = null;
    }
  }, []);

  // Navigate to section
  const handleNavigate = (path, event) => {
    console.log(`Navigating to: ${path}`);
  };

  // Handle section expand/collapse
  const handleSectionClick = useCallback((sectionId, event, isExpandable) => {
    event.stopPropagation();

    if (!isExpandable || isAnimating) {
      return;
    }

    clearPendingAnimations();
    setIsAnimating(true);

    setExpandedSection(prevExpanded => prevExpanded === sectionId ? null : sectionId);
    setExpandedSubsection(null);

    // Release animation lock after animation completes
    animationTimeoutRef.current = setTimeout(() => {
      setIsAnimating(false);
    }, 350);
  }, [isAnimating, clearPendingAnimations]);

  // Handle subsection expand/collapse - simplified to match section handler pattern
  const handleSubsectionClick = useCallback((subsectionId, event, isExpandable) => {
    event.stopPropagation();

    if (!isExpandable || isAnimating) {
      return;
    }

    clearPendingAnimations();
    setIsAnimating(true);

    setExpandedSubsection(prevExpanded => prevExpanded === subsectionId ? null : subsectionId);

    // Release animation lock after animation completes
    animationTimeoutRef.current = setTimeout(() => {
      setIsAnimating(false);
    }, 350);
  }, [isAnimating, clearPendingAnimations]);

  // Render SVG icons for main sections
  const renderIcon = (iconType) => {
    switch(iconType) {
      case 'circles':
        return (
          <div className="icon-container">
            <svg width="42" height="42" viewBox="0 0 42 42" fill="none" xmlns="http://www.w3.org/2000/svg">
              <circle cx="21" cy="21" r="14" stroke="#A08E61" strokeWidth="1.5" opacity="0.9" />
              <circle cx="16" cy="21" r="9" stroke="#A08E61" strokeWidth="1.5" opacity="0.7" />
              <circle cx="26" cy="21" r="9" stroke="#A08E61" strokeWidth="1.5" opacity="0.7" />
            </svg>
          </div>
        );
      case 'triangle':
        return (
          <div className="icon-container">
            <svg width="42" height="42" viewBox="0 0 42 42" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M21 7L35 32H7L21 7Z" stroke="#A08E61" strokeWidth="1.5" opacity="0.9" />
            </svg>
          </div>
        );
      case 'targetCircle':
        return (
          <div className="icon-container">
            <svg width="42" height="42" viewBox="0 0 42 42" fill="none" xmlns="http://www.w3.org/2000/svg">
              <circle cx="21" cy="21" r="14" stroke="#A08E61" strokeWidth="1.5" opacity="0.9" />
              <circle cx="21" cy="21" r="5" fill="#A08E61" opacity="0.7" />
            </svg>
          </div>
        );
      default:
        return null;
    }
  };

  // Main section animation settings
  const sectionVariants = {
    hidden: { opacity: 0, x: -15 },
    visible: (i) => ({
      opacity: 1,
      x: 0,
      transition: {
        duration: 0.4,
        ease: "easeInOut",
        delay: i * 0.15 + 0.3
      }
    })
  };

  // Container animation settings - for both subsection and nested containers
  const containerVariants = {
    closed: { 
      height: 0,
      opacity: 0,
      transition: {
        height: { duration: 0.25, ease: "easeInOut" },
        opacity: { duration: 0.2 }
      }
    },
    open: { 
      height: "auto",
      opacity: 1,
      transition: {
        height: { duration: 0.25, ease: "easeInOut" },
        opacity: { duration: 0.25, delay: 0.05 }
      }
    }
  };

  return (
    <div className={`sections-container ${isAnimating ? 'animating' : ''}`}>
      {mainSections.map((section, index) => (
        <motion.div 
          key={section.id} 
          className={`section-wrapper ${expandedSection === section.id ? 'expanded-section' : ''}`}
          custom={index}
          initial="hidden"
          animate="visible"
          variants={sectionVariants}
        >
          <div 
            className={`section-row ${activeSection === section.id ? 'active' : ''} ${expandedSection === section.id ? 'expanded' : ''}`}
            onMouseEnter={() => setActiveSection(section.id)}
            onMouseLeave={() => setActiveSection(null)}
            onClick={(e) => {
              if (section.expandable) {
                handleSectionClick(section.id, e, section.expandable);
              } else {
                handleNavigate(section.path, e);
              }
            }}
          >
            <div className="section-content">
              <div className="section-icon-wrapper">
                {renderIcon(section.icon)}
              </div>
              <div className="section-text">
                <h2 className="section-title">{section.title}</h2>
                <p className="section-description">{section.description}</p>
              </div>
              {section.expandable && (
                <div className={`expand-indicator ${expandedSection === section.id ? 'expanded' : ''}`}>
                  <svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <path d="M4 6L8 10L12 6" stroke="#A08E61" strokeWidth="1.5" strokeLinecap="round" />
                  </svg>
                </div>
              )}
            </div>
            <div className="diagonal-cut" />
          </div>

          {/* Expandable Subsections - Using the AnimatePresence pattern from the main component */}
          {section.expandable && (
            <AnimatePresence initial={false}>
              {expandedSection === section.id && (
                <motion.div 
                  className="subsections-container framer-controlled"
                  key={`section-${section.id}-subsections`}
                  initial="closed"
                  animate="open"
                  exit="closed"
                  variants={containerVariants}
                >
                  {section.subsections.map((subsection, i) => (
                    <motion.div 
                      key={subsection.id}
                      className={`subsection-wrapper framer-controlled ${expandedSubsection === subsection.id ? 'expanded-subsection' : ''}`}
                      initial={{ opacity: 0, x: -10 }}
                      animate={{ 
                        opacity: 1, 
                        x: 0, 
                        transition: { delay: 0.15 + (i * 0.05), duration: 0.2 } 
                      }}
                    >
                      <div 
                        className="subsection-row framer-controlled"
                        onClick={(e) => {
                          if (subsection.expandable) {
                            handleSubsectionClick(subsection.id, e, subsection.expandable);
                          } else {
                            handleNavigate(subsection.path, e);
                          }
                        }}
                      >
                        <div className="subsection-content">
                          <h3 className="subsection-title">{subsection.title}</h3>
                          <p className="subsection-description">{subsection.description}</p>
                          {subsection.expandable && (
                            <div className={`expand-indicator small ${expandedSubsection === subsection.id ? 'expanded' : ''}`}>
                              <svg width="12" height="12" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg">
                                <path d="M4 6L8 10L12 6" stroke="#A08E61" strokeWidth="1.5" strokeLinecap="round" />
                              </svg>
                            </div>
                          )}
                        </div>
                      </div>

                      {/* Nested Subsections - Using identical pattern as subsections */}
                      {subsection.expandable && (
                        <AnimatePresence initial={false}>
                          {expandedSubsection === subsection.id && (
                            <motion.div 
                              className="nested-subsections-container framer-controlled"
                              key={`subsection-${subsection.id}-nested`}
                              initial="closed"
                              animate="open"
                              exit="closed"
                              variants={containerVariants}
                            >
                              {subsection.subsections.map((nestedSubsection, j) => (
                                <motion.div 
                                  key={nestedSubsection.id}
                                  className="nested-subsection-row framer-controlled"
                                  onClick={(e) => handleNavigate(nestedSubsection.path, e)}
                                  initial={{ opacity: 0, x: -5 }}
                                  animate={{ 
                                    opacity: 1, 
                                    x: 0,
                                    transition: { delay: 0.15 + (j * 0.05), duration: 0.2 }
                                  }}
                                >
                                  <div className="nested-subsection-content">
                                    <h4 className="nested-subsection-title">{nestedSubsection.title}</h4>
                                    <p className="nested-subsection-description">{nestedSubsection.description}</p>
                                  </div>
                                </motion.div>
                              ))}
                            </motion.div>
                          )}
                        </AnimatePresence>
                      )}
                    </motion.div>
                  ))}
                </motion.div>
              )}
            </AnimatePresence>
          )}
        </motion.div>
      ))}
    </div>
  );
};

export default LandingNavigation;
